import React from "react";
import logo from "../img/entur_logo.jpg";
import user from "../img/user.png";

class NavBar extends React.Component {

    onClick = () => {

    };

    render() {
        return (
            <nav className="navBar">
                <div className="padding" onClick={this.onClick}>
                    <a href="/"><img src={logo} width={180} height={80} alt="Entur" /></a>
                    <div id="login">
                        <img id="user" src={user} width={50} height={50} alt="Login" />
                        <p className="text-center text-white">{this.props.user}</p>
                    </div>
                </div>
                <div id="logout">
                    <a href={this.props.logout}><h6 className="text-center text-white">LOGG UT</h6></a>
                </div>
            </nav>
        )
    }
}

export default NavBar;
